description:
This is LuaJIT 2.0.0 (release candidate 2) binaries for Windows.
LuaJIT git HEAD as of November 6 2012 was compiled using MS Visual Studio 2005
with LUAJIT_ENABLE_LUA52COMPAT option (see http://luajit.org/extensions.html#lua52).

Latest version of LuaJIT binaries for Windows is available at &lt;a href=&quot;
http://luajit4win.no-ip.org&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://luajit4win.no-ip.org&lt;/a&gt;
